import React from "react";

import CustomPieChart from "components/Graphs/PieChart";

const data1 = [
    {
        "id": "stylus",
        "label": "stylus",
        "value": 388,
        "color": "hsl(33, 70%, 50%)"
    },
    {
        "id": "haskell",
        "label": "haskell",
        "value": 227,
        "color": "hsl(264, 70%, 50%)"
    },
    {
        "id": "elixir",
        "label": "elixir",
        "value": 81,
        "color": "green"
    },
    {
        "id": "php",
        "label": "php",
        "value": 324,
        "color": "red"
    },
    {
        "id": "python",
        "label": "python",
        "value": 252,
        "color": "blue"
    }
]

export default function Kpi4() {
    return (
        <div>
            <CustomPieChart data={data1} />
        </div>
    )
}
